settings.colorFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', amount = percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var type = data['Type'];

var status = 'normal';

var text = getDeviceText(type, status);

var width = 30 + getTextWidth(text);

var svgStr = getDeviceSvg(type, status, width, text);

var encodedSvg = encodeURIComponent(svgStr);

var svgUrl = 'data:image/svg+xml,' + encodedSvg;

return {
    url: svgUrl,
    size: width,
    markerOffset: [15, 15],
    tooltipOffset: [width * 0.5 - 15, -15]
};


function getDeviceSvg(type, status, width, text) {
    var shape = getDeviceShape(type);
    var color = getBackgroundColor(type, status);
    var background = getDeviceBackground(type, color, width);
    var deviceSvg = '<svg width="' + width + '" height="30" viewBox="0 0 ' + width + ' 30" fill="none" xmlns="http://www.w3.org/2000/svg">' +
                    background +
                    shape;
    if (status === 'disconnected') {
        deviceSvg += '<path d="M6.92896 21.728L21.0711 7.58589L22.4853 9.00011L8.34317 23.1422L6.92896 21.728Z" fill="' + color + '"/>' +
                     '<path d="M7.10692 21.3171C6.81393 21.0241 6.81393 20.5491 7.10692 20.2561L20.1852 7.17788C20.4781 6.88489 20.9532 6.88489 21.2462 7.17788V7.17788C21.5392 7.47088 21.5392 7.94591 21.2462 8.2389L8.16794 21.3171C7.87495 21.6101 7.39991 21.6101 7.10692 21.3171V21.3171Z" fill="white"/>';
    }
    if (text !== '') {
        deviceSvg += '<text transform="translate(30 6)" fill="white" xml:space="preserve" style="white-space: pre" font-family="Roboto" font-size="15.4" font-weight="500" letter-spacing="0em"><tspan x="0.10664" y="14.2637">' + text + '</tspan></text>';
    }
    deviceSvg += '</svg>';
    return deviceSvg;    
}

function getDeviceBackground(type, color, width) {
     if (width === 30) {
         return '<circle cx="15" cy="15" r="15" fill="'+ color +'"/>';
     } else {
         return '<circle cx="15" cy="15" r="15" fill="'+ color +'"/>' + 
                '<circle cx="' + (width - 15) + '" cy="15" r="15" fill="'+ color +'"/>' +
                '<rect x="15" y="0" width="' + (width - 30) + '" height="30" rx="1" fill="'+ color +'"/>';
     }
}

function getBackgroundColor(type, status) {
    switch(status) {
        case 'major':
            return '#D5C21B';
        case 'critical':   
            return '#E64A19';
        case 'off':
        case 'disconnected':
            return '#CAC1D2';
        case 'normal':
        default:    
            switch(type) {
                case 'Freezer':
                case 'Chiller':
                    return '#4A8AEC';
                default:
                    return '#1F8B4D';
            }
            break;
    }
}

function getTextWidth(text) {
    var width = 0;
    for (var i = 0; i < text.length; i++) {
        var charWidth;
        var character = text.charAt(i);
        if (character === ' ') {
            charWidth = 8;
        } else if (character === '-') {
            charWidth = 7;
        } else if (character === '°') {
            charWidth = 5;
        } else if (!isNaN(character * 1)){
            charWidth = 9;
        } else {
            // Upper case
            if (character === character.toUpperCase()) {
                charWidth = 12;
            // Lower case    
            } else {
                charWidth = 10;
            }
        }
        width += charWidth;
    }
    return width;
}

function getDeviceText(type, status) {
    switch(status) {
        case 'disconnected':
            return 'NO CONN';
        case 'normal':
        default:    
            switch(type) {
                case 'Freezer':
                case 'Chiller':
                    var temperature = data['temperature'];
                    return temperature + ' °C';
                default:
                    return '';
            }
            break;        
    }
}

