settings.labelFunction:
var deviceType = data['Type'];
var coordinates = data['coordinates'];
var status = 'normal';
if (deviceType === 'Smart Shelf') {
    if (coordinates && coordinates.length === 4) {
        var color = getColor(status);
        var label = 'Vegetables';
        return '<span style="margin-left: 100px; margin-top: -50px; color: '+ color +';">' + label + '</span>';
    }
}
return '';

function getColor(status) {
    switch(status) {
        case 'major':
            return '#D5C21B';
        case 'critical':   
            return '#E64A19';
        case 'off':
        case 'disconnected':
            return '#CAC1D2';
        case 'normal':
        default:    
            return '#817889';
    }
}

settings.tooltipFunction:
var deviceType = dsData[dsIndex]['Type'];
if (typeof deviceType !== undefined) {
    if (deviceType == "Smart Shelf") {
        return '<b>${entityName}</b><br/><b>Weight:</b> ${weight:2} Kg<br/>';
    } else if (deviceType == "thermometer") {
        return '<b>${entityName}</b><br/><b>Temperature:</b> ${temperature:2} °C<br/>';
    }
}

